import React from 'react'
import  { Box } from '@mui/material'
import { Dropdown } from './Dropdown';


const genes = [
    'BRCA1', 
    'BRCA2',
    'GEMS', 
    'XYZ'
]

export const Graph = () => {

    return (
        <Box 
            sx= {{
                backgroundcolor: 'primary.main',
                color: 'white',
                height: '200px',
                width: '120px',
                paddig: '16px',
                '&:hover': {
                    backgroundcolor: 'primary.light'
                }
            }}
        >
            <Dropdown data={genes} />
        </Box>
    )

}
